import{_ as t,a as s}from"./008-BK48VWhW.js";import{_ as a}from"./385-D1UyzrJC.js";import{_ as n}from"./009-B_xeZwXD.js";import{_ as r}from"./010-C_sEQWkL.js";import{_ as g}from"./011-BzP10_Dy.js";import{_ as o}from"./012-CnJZn6pa.js";import{_ as e}from"./189-DW9Bhami.js";import{_ as p}from"./013-BwkHrzI2.js";import{_ as i}from"./014-D72OM-cE.js";import{_ as m,c,a as l,o as v}from"./app-CUu1n7_5.js";const f="/parts-intellect-docs/assets/431-B3q5MUfZ.png",I="/parts-intellect-docs/assets/432-D6UxSrXQ.png",d="data:image/png;base64,",C="data:image/png;base64,",E="data:image/png;base64,",T="data:image/png;base64,",u="/parts-intellect-docs/assets/437-B9-9zApU.png",D="data:image/png;base64,",w="data:image/png;base64,",B="/parts-intellect-docs/assets/440-Bby_JH0P.png",V="data:image/png;base64,",b="data:image/png;base64,",X="data:image/png;base64,",k="data:image/png;base64,",x="data:image/png;base64,",K={};function Y(P,A){return v(),c("div",null,A[0]||(A[0]=[l('<p>В программе существует два вида резерва:</p><ul><li><p><strong>Принудительный</strong> – за клиентом создается документ <strong>Резервирование</strong>. Зарезервированный товар будет закреплен за клиентом промежуток времени, указанный при создании резерва. По истечению выбранного промежутка времени товар в резерве перейдет в статус &quot;Документ просрочен&quot;. В этом случае на панели управления необходимо нажать команду <strong>Отменить просроченные</strong> (в пункте <strong>Действие</strong>), это действие автоматически создаст и проведет документ <strong>Отмена резерва</strong>. Если клиент отказался от резервирования до окончания срока резерва, то на основании <strong>Резервирования</strong> создается документ <strong>Отмена резерва</strong>.</p></li><li><p><strong>Автоматический</strong> – наступает после оприходования товара, который был ранее заказан в <strong>Заказе клиента</strong>. На товар в резерве накладывается ограничение – его нельзя продать другому клиенту до отмены резерва.</p></li></ul><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>При попытке создания документа с зарезервированными позициями выводится уведомление: <em>Для создания документа (Наименование документа) доступных позиций нет</em>.</p></div><p>Для создания нового резерва выполните следующие действия:</p><p><strong>»</strong> В <strong>Главном меню</strong> выберите пункт <strong>CRM</strong> ► <strong>Резервирования</strong>. Отобразятся элементы раздела <strong>Резервирование</strong>.</p><p><img src="'+f+'" alt=""></p><p><strong>»</strong> Для добавления нового документа нажмите кнопку <strong>Новый</strong> на панели управления. Отобразится окно инспектора для добавления нового резерва. Заполните необходимые параметры документа (обязательные для заполнения поля выделены жирным шрифтом).</p><p><img src="'+I+'" alt=""></p><p><img src="'+t+'" alt=""><strong>Основные параметры</strong></p><p>Блок содержит параметры:</p><ul><li><p><strong>Дата</strong> – дата и время начала резерва;</p></li><li><p><strong>Номер</strong> – номер документа. Возможен как ручной ввод, так и автозаполнение;</p></li><li><p><strong>Резерв до</strong> – дата окончания резерва. По достижении этой даты позиции в документе получат статус <strong>Документ просрочен</strong>;</p></li><li><p><strong>Наша фирма</strong> – от какой нашей фирмы резерв;</p></li><li><p><strong>Клиент</strong> – на какого контрагента оформлен резерв.</p></li></ul><p><img src="'+s+'" alt=""><strong>Дополнительные параметры</strong></p><p>Блок содержит параметры:</p><ul><li><strong>Валюта *</strong> – валюта цен в документе. Если изменить валюту документа, программа предложит сконвертировать цены на позиции по текущему курсу для валют.</li></ul><p><img src="'+a+'" alt=""></p><ul><li><p><strong>Отметка</strong> – отметка для документа из справочника;</p></li><li><p><strong>Стоимость доставки</strong> – стратегия учета стоимости доставки в итоговой цене закупа:</p><ul><li><p><strong>Не включать стоимость доставки</strong> – суммарное значение по колонке <strong>Стоимость доставки</strong> не будет влиять на сумму итого по документу;</p></li><li><p><strong>Включать стоимость без учета скидки</strong> – сумма колонки <strong>Стоимость доставки</strong> будет прибавлена к сумме итого по документу;</p></li><li><p><strong>Включать стоимость с учетом скидки</strong> – сумма колонки <strong>Стоимость доставки</strong> будет прибавлена к сумме итого по документу с учетом скидки поля <strong>Скидка/Наценка, %</strong> документа.</p></li></ul></li><li><p><strong>Выделять НДС</strong> – стратегия выделения НДС в документе. По умолчанию значение берется из карточки <strong>Нашей фирмы</strong>.</p></li></ul><p><img src="'+n+'" alt=""><strong>Общее</strong></p><p>Блок содержит поле <strong>Комментарий</strong> – позволяет оставить пометку к текущему документу.</p><p><img src="'+r+'" alt=""><strong>Табличная часть</strong></p><p>Содержит список позиций добавленных к резервированию. А так же команды для выполнения действий с позициями документа:</p><ul><li><p><strong>Добавить</strong> – позволяет открыть мастер выбора позиций для резервирования;</p></li><li><p><strong>Удалить</strong> – позволяет удалить выбранные позиции;</p></li><li><p><strong>Действия с позицией</strong> – содержит команду <strong>Приоритетный склад</strong>, которая позволяет указать <strong>Приоритетный склад списания</strong> из справочника <strong>Склады/Торговые точки</strong>. Указать приоритетный склад для списания можно так же в самой позиции документа, в колонке <strong>Приоритетный склад для списания</strong>. По умолчанию списание товара (в момент проводки) будет осуществляться среди всех складов <strong>Доступных для списания</strong> пользователю, по действующему в системе <strong>Способу списания товара ФИФО/ЛИФО</strong> в разделе меню <strong>Управление ► Настройки программы ► Настройки ►</strong> группа <strong>Склад и закупки ► Движение товара</strong>.</p></li></ul><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>В случае отсутствия товара на выбранном <strong>Складе</strong>, списание товара будет произведено со вложенных в этот склад <strong>Мест хранений</strong> (при активном значении настройки <strong>Подбирать товары сначала на приоритетном складе/ТТ, а затем на вложенных в него МХ</strong> из раздела <strong>Управление ► Настройки программы ► Настройки ►</strong> группа <strong>Склад и закупки ► Движение товара</strong>).</p><p>В случае отсутствия товара на выбранном <strong>Месте хранения</strong>, списание товара будет произведено со вложенных в него <strong>Мест хранений</strong> (при активном значении настройки <strong>Перемещать товары сначала с выбранного МХ, а затем с вложенных в него МХ</strong> из раздела <strong>Управление ► Настройки программы ► Настройки ►</strong> группа <strong>Склад и закупки ► Движение товара</strong>).</p></div><div class="hint-container info"><p class="hint-container-title">Примечание</p><p>В разрешениях пользователя (<strong>Управление ► Настройки программы ► Роли пользователей ► Разрешения для роли пользователей ► Документы ► Резервирования</strong>) доступна опция <strong>Списание/резервирование товаров со складов/МХ, отличных от приоритетного</strong>, которая активирует проверку доступного количества товара на складе при проводке документа. Если количество товара из наличия недостаточно, то программа выдаст соответствующее уведомление.</p></div><p><img src="'+g+'" alt=""><strong>Сохранить и закрыть/Сохранить</strong></p><p><img src="'+d+'" alt=""></p><p>Позволяет сохранить и закрыть/сохранить документ <strong>Резерв из наличия</strong> без проводки.</p><p><img src="'+o+'" alt=""><strong>Сменить состояние</strong></p><p><img src="'+C+'" alt=""></p><p><img src="'+e+'" alt=""></p><p>Позволяет осуществить проводку документа или отменить ее, в случае необходимости. А так же добавить документ в архив или извлечь его из архива.</p><p><img src="'+p+'" alt=""><strong>Создать на основании</strong></p><p><img src="'+E+'" alt=""></p><p><img src="'+T+'" alt=""></p><p>Позволяет выполнить:</p><ul><li><p><strong>Отмену резерва</strong> – в случае если на основании <strong>Резерва из наличия</strong> создавались документы;</p></li><li><p><strong>Расходная накладная</strong> – расходная накладная на основе <strong>Резерва из наличия</strong>;</p></li><li><p><strong>Отмена всех просроченных резервов</strong> – для всех документов, срок окончания которых истек.</p></li></ul><p><strong>»</strong> Добавите товары в заказ с помощью кнопки <strong>Добавить</strong>, при этом появится мастер выбора позиций для резервирования. Настройте фильтр для отбора списка позиций:</p><p><img src="'+u+'" alt=""></p><p><img src="'+t+'" alt=""><strong>Фильтр по дате</strong></p><p><img src="'+D+'" alt=""></p><p>В блоке указывается период, в который попадают документы, формирующие наличие (приходные накладные, отказ клиента и т.д.).</p><p><img src="'+s+'" alt=""><strong>Дополнительный фильтр</strong></p><p><img src="'+w+'" alt=""></p><p>Позволяет указать известную часть названия товара и/или номера документов (формирующих наличие требуемого товара), при необходимости.</p><p><img src="'+n+'" alt=""><strong>Контрагенты/Места хранения</strong></p><p><img src="'+B+'" alt=""></p><p>Позволяет отфильтровать документы, формирующие наличие по параметрам:</p><ul><li><p><strong>Поставщик</strong>;</p></li><li><p><strong>Клиент</strong>;</p></li><li><p><strong>Наша фирма</strong>;</p></li><li><p><strong>Склад</strong>.</p></li></ul><p><img src="'+r+'" alt=""><strong>Поиск детали</strong></p><p><img src="'+V+'" alt=""></p><p>Позволяет осуществить поиск необходимых позиций по коду детали, с использованием соответствующих параметров поиска.</p><p><img src="'+g+'" alt=""><strong>Выбрать</strong></p><p><img src="'+b+'" alt=""></p><p>Позволяет осуществить перенос позиций из таблицы <strong>Доступных позиций</strong> в <strong>Выбранные</strong>.</p><p><img src="'+o+'" alt=""><strong>Импорт</strong></p><p><img src="'+X+'" alt=""></p><p>Позволяет выбрать позиций из документа.</p><p><img src="'+p+'" alt=""><strong>Очистить</strong></p><p><img src="'+k+'" alt=""></p><p>Позволяет удалить выбранные или все позиции из табличной части.</p><p><img src="'+i+'" alt=""><strong>Выбрать</strong></p><p><img src="'+x+'" alt=""></p><p>Позволяет добавить выбранные позиции в документ.</p><p><strong>»</strong> После настройки фильтра в табличной части <strong>Доступные позиции</strong> отражаются товары, удовлетворяющие условию фильтрации. Из данного списка необходимо выбрать требуемые для резервирования позиции и нажать кнопку <strong>Выбрать[Enter]</strong>.</p><p><strong>»</strong> Как только список полностью готов, нажмите кнопку <strong>Выбрать</strong>, тем самым товары попадут в документ.</p><p><strong>»</strong> Для вступления документа <strong>Резерв из наличия</strong> в силу его необходимо провести. Для этого нажмите кнопку <strong>Сменить состояние</strong> и выберите пункт <strong>Провести</strong> (Ctrl+E).</p><p><strong>»</strong> Для того чтобы сохранить и закрыть документ (можно и без проведения) воспользуйтесь кнопкой <strong>Сохранить и закрыть</strong> (F2).</p><p>Для отмены резерва следует нажать команду <strong>Создать на основании</strong> и выбрать документ <strong>Отмена резерва</strong>. Но если на основании резерва не создавались документы, можно просто отметить проводку в документе и удалить его.</p><p>Для отмены <strong>просроченных</strong> документов (срок окончания резерва закончился) и помещения их в архив необходимо вызвать команду <strong>Отмена всех просроченных резервов</strong> и просроченные документы автоматически закроются документами <strong>Отмена резерва</strong>, а затем поместятся в <strong>Архив</strong>. Команда выполняется сразу для всех документов <strong>Резервирование</strong>. По окончанию выполнения команды выводится информация о результатах. Команда доступна для пользователей, у которых включены разрешения на создание и проведение документа <strong>Отмена резерва</strong> и на перемещение документа <strong>Резервирование</strong> в <strong>Архив</strong>.</p>',68)]))}const H=m(K,[["render",Y]]),J=JSON.parse('{"path":"/work/zakazy/formirovanie_zakaza/rezervirovanie_tovara_dlya_klienta.html","title":"Резервирование товара для клиента","lang":"en-US","frontmatter":{"title":"Резервирование товара для клиента","createTime":"2025/05/21 12:15:17"},"headers":[],"readingTime":{"minutes":3.44,"words":1031},"git":{"updatedTime":1748435573000,"contributors":[{"name":"bONK-cup","username":"bONK-cup","email":"kokosik260302@gmail.com","commits":1,"avatar":"https://avatars.githubusercontent.com/bONK-cup?v=4","url":"https://github.com/bONK-cup"},{"name":"a.lutoshkin","username":"","email":"a.lutoshkin@tradesoft.ru","commits":1,"avatar":"https://gravatar.com/avatar/605ee9d365e3a6380f8e9c71f9269ee5373d537aebefbece4e023cac396dfc8d?d=retro"}]},"filePathRelative":"work/zakazy/formirovanie_zakaza/rezervirovanie_tovara_dlya_klienta.md","categoryList":[{"id":"67e92c","sort":10000,"name":"work"},{"id":"afc18a","sort":10073,"name":"zakazy"},{"id":"044b35","sort":10114,"name":"formirovanie_zakaza"}]}');export{H as comp,J as data};
